const NavBar = () => {

    const navStyle = {
      backgroundColor: '#666666',
      height: '4.5rem',
      width: '100%',
      padding: '.8rem',
      overflow: 'hidden'
    }

    const listStyle = {

    }

    return (
        <nav style={navStyle}>
          <ul style={listStyle}>
            <li class="nav__item"><a href="#post1" class="nav__link">Start</a></li>
            <li class="nav__item"><a href="#post2" class="nav__link">About Us</a></li>
            <li class="nav__item"><a href="#post3" class="nav__link">News</a></li>
            <li class="nav__item"><a href="#post4" class="nav__link">Contact</a></li>
                    </ul>
            </nav>
    )
}

export default NavBar
